import { View } from "react-native";
import { Text, StyleSheet } from "react-native";


const HomeWorkScreen = () => {

    const myName = 'Arda';
    
    return(
        <View>
            <Text style={StyleSheet.textStyleForHeader} >Gettin started with react native√©</Text>
            <Text style={StyleSheet.textStyleForNormal} >My name is {myName}</Text>


        </View>

    );

    const style = StyleSheet.create({

        textStyleForHeader:{
            fontSize: 40
        },
        textStyleForNormal:{
            fontSize: 20
        }



    }
    );


};

export default HomeWorkScreen;
